        event.preventDefault();
        fetch('/addMaterial',{
            method: 'POST',
            body:JSON.stringify(data),
            headers:{
                'Accept' : 'application/json',
                'Content-Type' : 'application/json'
            }
        })
        .then(res => res.json())
        .then(data => ({
            idMaterial: 0,
            nombreMaterial: "",
            descripcionMaterial:"",
            estadoMaterial: false,
            cantidadMaterial: 0
        }))
    }
    function refresh_Page(event){
        console.log('recargando...');
        window.location.reload();
    }
    return(
        <div className="card">
            {validar}
            <form onSubmit={agregarDatos}>
                <div className="card-header">
                    <h1>Añadir nuevo Material {materialEditar}</h1>
                </div>
                <div className="card-body">
                    <label >Id:</label><br/>
                    <input type="text" name="idMaterial" className="form-control" placeholder="código" value={data.idMaterial} onChange={recibeDatos}/><br></br>

